import React from 'react';
import { QRCode } from 'qrcode';
import './index.css';

const QRCodeComponent = () => {
  return (
    <div className="qrcode-container">
      <QRCode value={window.location.href} renderAs="canvas"/>
    </div>
  );
};

export default QRCodeComponent;
